import React from 'react';
import Accueil from '../Accueil';
import Create from '../create';
import Delete from '../Delete';
import { NavLink } from 'react-router-dom';
const Navigation = () => {
    return (
        <div>
            <li>
                <ul>
                    <NavLink to="/">
                        Accueil
                    </NavLink>

                    {/* <NavLink to="/create">
                        Create
                    </NavLink> */}

                    <NavLink to="/update">
                        Update
                    </NavLink>

                    <NavLink to="/delete">
                        Delete
                    </NavLink>
                </ul>
            </li>
        </div >
    );
};

export default Navigation;
